import React from 'react';
import image from '../assets/1.jpg';
import Grid from "@material-ui/core/es/Grid/Grid";
import Paper from "@material-ui/core/es/Paper/Paper";


function App() {
  return (
      <div>
          <div style={{
              backgroundImage : "url("+ image+")",
              backgroundSize: "cover",
              opacity: 0.8,
              filter: "grayscale(80%)",
              backgroundPosition: "top center",
              minHeight:'100vh',
              height: "auto"}}>
              <Grid
                  direction="row"
                  justify="flex-end"
                  alignItems="center"
                  container spacing={3}
                  item xs={3}
                  style={{
                      position: 'relative',
                      top: 21,
                  }}>
                  <Grid
                        justify= "center"
                  >
                      <Paper elevation={3}
                      style={{
                          minHeight: 60,
                          width: '80%',
                          margin: '0px 50px',

                      }}>Hii</Paper>
                      <Paper
                      style={{
                          minHeight:"70vh"
                      }}>Hii</Paper>
                  </Grid>

              </Grid>
          </div>
      </div>
  );
}

export default App;
